import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import FormPage1 from './pages/FormPage1';
import FormPage2 from './pages/FormPage2';
import FormPage3 from './pages/FormPage3';

function App() {
    return (
        <div className="App">
            <Router>
                <Routes>
                    <Route path="/" element={<h1>Home Page</h1>} />  {/* Home page */}
                    <Route path="/firstname" element={<FormPage1 />} /> {/* Firstname Form Page */}
                    {/*<Route path="/lastname" element={<FormPage2 />} />  /!* Lastname Form Page *!/*/}
                    {/*<Route path="/username" element={<FormPage3 />} />  /!* Username Form Page *!/*/}
                </Routes>
            </Router>
        </div>
    );
}

export default App;
